import React, { Component } from 'react';
import GoogleMapReact from 'google-map-react';

const mapkey = "AIzaSyA5XxXKw44uRve7wAs046c_jGmKNhK6B1Y";

class Map extends Component {
  static defaultProps = {
    center: {
      lat: 43.59, //43.58560422
      lng: -79.70, //-79.69504396
    },
    zoom: 8
  };

  render() {
    return (
      <div id="mapContainer">
				<label>Or click somewhere on the map to see the forecast there</label>
        <GoogleMapReact
          bootstrapURLKeys={{ key: mapkey}}
          defaultCenter={this.props.center}
          defaultZoom={this.props.zoom}
					onClick={(e) => {console.log(e.lat); console.log(e.lng);}}
        >
        </GoogleMapReact>
      </div>
    );
  }
}

export default Map;
